import React from 'react';
import styled from "styled-components";
const AdminProgress = (data) => {
 
 const getApplicationApproval = () => {
   const TotalApplication = data.Applications.length;
   const ApprovedTotal = data.Applications.filter(application => application.status === 'Approved')
   return (ApprovedTotal * 100)/TotalApplication
 }
 return (
  <AdminProgressWith>
   <div className="admin-wrapper">
     <div className="stats-1" stats={getApplicationApproval()}></div>
     <div className="stats-2"></div>
   </div>
  </AdminProgressWith>
 );
};

const AdminProgressWith = styled.div`

`

export default AdminProgress;
